    const [isLoggedIn, setIsLoggedIn] = useState(false);

    return (
        <AppLayout>
                {localStorage.getItem("ACCESS_TOKEN") ? <UserProfile/> : <LoginForm/>}
        </AppLayout>
    );
}

export default Home;
